import React from 'react';
import { withStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Container from '@material-ui/core/Container';
import Button from '@material-ui/core/Button';
import api from '../api';

const useStyles = theme => ({
    layout: {
        width: 'auto',
        marginLeft: theme.spacing(2),
        marginRight: theme.spacing(2),
        [theme.breakpoints.up(600 + theme.spacing(2) * 2)]: {
            width: 600,
            marginLeft: 'auto',
            marginRight: 'auto',
        },
    },
    paper: {
        marginTop: theme.spacing(3),
        marginBottom: theme.spacing(3),
        padding: theme.spacing(2),
        [theme.breakpoints.up(600 + theme.spacing(3) * 2)]: {
            marginTop: theme.spacing(6),
            marginBottom: theme.spacing(6),
            padding: theme.spacing(3),
        },
    },
});

class insertCust extends React.Component{
    constructor(props){
        super(props);
        const { match: { params } } = this.props;
        
        this.state = {
            name: '',
            orgid:params.id,
            cname:'',
            email:'',
        }
    }

    render(props) {
        const { classes } = this.props;
        return (
            <React.Fragment>
                <Container component="main" maxWidth="sm">
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                        <TextField
                            id="company"
                            label="Company"
                            style={{ margin: 8 }}
                            fullWidth
                            margin="normal"
                            InputLabelProps={{
                                shrink: true,
                            }}
                            variant="outlined"
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="contact" label="Contact Name" value={this.state.cname} />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField id="email" label="Contact Email" value={this.state.email} />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <Button variant="outlined" color="primary" onClick={this.handleIncludeMovie}>Save</Button>&nbsp;&nbsp;
                        </Grid>
                    </Grid>
                    </Container>
            </React.Fragment>
        );
    }
}

export default insertCust;
